INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 2, 60003, 2, 0, "", 0, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 526, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 2, 60003, 2, 0, "", 0, "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 527, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 2, 60003, 2, 0, "", 0, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 528, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 2, 60003, 2, 0, "", 0, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 529, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 3, 60003, 2, 0, "", 0, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 530, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 3, 60003, 2, 0, "", 0, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 531, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 3, 60003, 2, 0, "", 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 532, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 3, 60003, 2, 0, "", 0, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 533, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 3, 60003, 2, 0, "", 0, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 534, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 3, 60003, 2, 0, "", 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 535, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 3, 60003, 2, 0, "", 0, "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 536, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 4, 60003, 2, 0, "", 0, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 537, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 4, 60003, 2, 0, "", 0, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 538, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 4, 60003, 2, 0, "", 0, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 539, 0);
