INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 2, 60005, 2, 0, "", 0, "今日の運勢は大吉！　お出かけするといいことあるかも？　　　　また一緒に、お忍びデートしてくださいね……騎士♪", 582, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 2, 60005, 2, 0, "", 0, "今日の運勢は大吉！　転居するならあたたかい場所が吉！　　　　煉獄の世なれど、住めば都と申しんす。ゆるりときなんせ……♪", 583, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 3, 60005, 2, 0, "", 0, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 584, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 3, 60005, 2, 0, "", 0, "今日の運勢は中吉！　誰かに尽くすことで掴める幸せもあるかも？\n人事を尽くして天命を待つ！　さ、年始もバリバリ働きますわよ♪", 585, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 3, 60005, 2, 0, "", 0, "今日の運勢は中吉！　歌を口ずさみ、幸運を呼び込もう！\n幸運になれるかは分からないけど……一緒に、歌いましょ？", 586, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 3, 60005, 2, 0, "", 0, "今日の運勢は中吉！　健康に気を遣って気持ちのいい一年を！\n体に不調があるときは遠慮なく言いなさい、隅々まで調べてあげる", 587, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 3, 60005, 2, 0, "", 0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 588, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 3, 60005, 2, 0, "", 0, "今日の運勢は中吉！　争いごとは勝つが油断は大敵！　　　　　　ま、このあたしと一緒なら、向かうところ敵はねーですよっ！", 589, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 3, 60005, 2, 0, "", 0, "今日の運勢は中吉！　ラッキーアイテムは「光るもの」！　　　　ハツネちゃんの「きらーんっ☆」な魔法、見せちゃおうかなっ？", 590, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 4, 60005, 2, 0, "", 0, "今日の運勢は小吉！　のんびり穏やかな一日となるでしょう！　　あなた様を邪魔するものは全てエリコが排除しますわ、クスクス♪", 591, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 4, 60005, 2, 0, "", 0, "今日の運勢は小吉！　小さな勇気で踏み出す一歩が大事！\n遠くから見てるだけじゃダメ。今日は、少しだけ近づいてみます！", 592, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 4, 60005, 2, 0, "", 0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 593, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 4, 60005, 2, 0, "", 0, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 594, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 4, 60005, 2, 0, "", 0, "今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", 595, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 4, 60005, 2, 0, "", 0, "今日の運勢は小吉！　空を眺めると気持ちが晴れやかに！　　　　眺めるだけじゃなくて、ひとっ飛びしちゃいましょうかっ♪", 596, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 4, 60005, 2, 0, "", 0, "今日の運勢は小吉！　掃除をすると運勢が開けそう！　　　　　　「わ、めんど」「ヴルムっ！　新年早々サボっちゃダメなんだからね！」", 597, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "カリン", 0, 60005, 3, 190804, "", 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 598, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, "カリン", 0, 60005, 3, 190804, "", 7, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 599, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 1, "カリン", 0, 60006, 1, 190804, "", 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 600, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 1, 60006, 2, 0, "", 0, "今日の運勢は姫吉！　勇気を持って、新しいことに挑戦しよう！\n幸先がいいねえ少年！　今年もいい一年になるよう祈ってるよ。", 601, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 1, 60006, 2, 0, "", 0, "今日の運勢は姫吉！　どんなピンチも簡単に乗り越えられそう！\nよい結果が出たようで何よりです。さて、待人の方は……ふふ。", 602, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 1, 60006, 2, 0, "", 0, "今日の運勢は姫吉！　あの人と仲直り……できちゃうかも！？\nはあ……この私があなたの運勢に興味を抱くわけないでしょう？", 603, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 2, 60006, 2, 0, "", 0, "今日の運勢は大吉！　身近な友達との絆が深まる予感……？\n騎士様は、どなたと友誼を結ぶのでしょう？　気になります……", 604, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 2, 60006, 2, 0, "", 0, "今日の運勢は大吉！　ラッキーアイテムは「蛇の抜け殻」！\nこのアタシにお目にかかれるなんて……アンタ、幸せものね♪", 605, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 3, 60006, 2, 0, "", 0, "今日の運勢は中吉！　気になるあの人に会えちゃうかも！？\n『初夢を正夢にする枕』であなたに会え……な、なんでもない！", 606, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 3, 60006, 2, 0, "", 0, "今日の運勢は中吉！　子供に戻って、一日中遊びつくそう！\nお年玉でけん玉ゲット！　おじちゃん、もしかめ一万回やって！", 607, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 1, "", 3, 60006, 2, 0, "", 0, "今日の運勢は中吉！　今日はおうちで、ゆーっくりくつろごう。\nお雑煮よし。みかんよし。さ、こたつで寝正月だ。君も入る？", 608, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 4, 60006, 2, 0, "", 0, "今日の運勢は小吉！　突然のドッキリに注意！\nおや、後ろに髪の長い女の霊が──フフ、冗談です。私ですよ。", 609, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 4, 60006, 2, 0, "", 0, "今日の運勢は小吉。慌てなくても、幸運はきっとやってくる。\n運は自分で掴むもの──媛が言ってました。でも、どうやって？", 610, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "カリン", 0, 60006, 3, 190804, "", 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 611, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, "カリン", 0, 60006, 3, 190804, "", 5, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 612, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 1, "カリン", 0, 60007, 1, 190804, "", 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 613, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 1, 60007, 2, 0, "", 0, "今日の運勢は姫吉！　絶好調で最高の一日になりそう♪\nわたしも、騎士クンが一緒ならいつだって最高に幸せな日だよ……", 614, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 1, 60007, 2, 0, "", 0, "今日の運勢は姫吉！　新しいことに挑戦するチャンス！\nお姉さんも一緒に挑戦しちゃおっかな♪　飲み処の新規開拓とか！", 615, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 1, 60007, 2, 0, "", 0, "今日の運勢は姫吉！　日々の努力が実を結ぶ予感！\n今日一日鍛錬に勤しむべき、ということだな。では早速行こうか。", 616, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 2, 60007, 2, 0, "", 0, "今日の運勢は大吉！　家族サービスにはぴったりの日！\nさっそく弟くんにあまあまお姉ちゃんの出血大サービス、だよっ♪", 617, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 2, 60007, 2, 0, "", 0, "今日の運勢は大吉！　笑顔で過ごせば周りもみんなハッピーかも！\n『笑う顔はフグになる』ですねっ。幸せいっぱいお届けしますっ", 618, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 3, 60007, 2, 0, "", 0, "今日の運勢は中吉！　恋愛運良し、積極的な行動に成果が！？\nじゃあ騎士さんのこと、拉致しちゃうとか★　恋愛成就確定です♥", 619, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 3, 60007, 2, 0, "", 0, "今日の運勢は中吉！　おめかししたら運気も上昇？\n毛並がふわふわになるまでブラッシングしたわ♪　ふふ、完璧ね！", 620, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 4, 60007, 2, 0, "", 0, "今日の運勢は小吉！　知らない場所に行くと新たな発見が！\n未知の場所……一人では恐ろしくて。騎士さま、どうかお力添えを", 621, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (0, 2, "", 4, 60007, 2, 0, "", 0, "今日の運勢は小吉！　ラッキーアイテムは鳥の羽根！\nだからって、私の羽を毟ろうとしないでくださ～いっ！", 622, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 0, "カリン", 0, 60007, 3, 190804, "", 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 623, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 0, "カリン", 0, 60007, 3, 190804, "", 5, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 624, 0);
